import React from 'react';
import '../navbar.css';

function NavBar(){
    return(
        <nav>
            <img></img>
            <ul>
                <li><a>Home</a></li>
                <li><a>Category</a></li>
                <li><a>About</a></li>
                <li><a>Contact</a></li>
            </ul>
            <form>
                <input>Search</input>
            </form>
            <button>Join the </button>
        </nav>
    );
}

export default NavBar;
